import s from "./Header.module.css";
import { ThemeContext } from "../context/ThemeContext";
import { useContext } from "react";

export default function Skills() {
	return (
		<div className={s.skillsContainer}>
			<div className={s.skillsTitle}>
				{" "}
				<h1>Skills</h1>
				<span className={s.skillsCustom1}>Hello</span>
			</div>
			<div className={s.skillsIcons}>
				<div className={s.skillsIcon1}></div>
				<div className={s.skillsIcon2}></div>
				<div className={s.skillsIcon3}></div>
				<div className={s.skillsIcon4}></div>
				<div className={s.skillsIcon5}></div>
			</div>
		</div>
	);
}
